import React from 'react'
import Banner from "../banner/Banner";
import Cards from "../cards/Cards";
import Container from "../container/Container";
import Navbar from "../navbar/Navbar";

function Home() {
  return (
    <>
    <Navbar />
    <Banner />
    <Container />
    <Cards />
    </>
  )
}

export default Home
